//<!-- 爱心特效 -->
(function(){
    document.oncontextmenu = function () {
            let audio1 = document.createElement("audio");
            audio1.style=`
            position: absolute;
            top: -999px;
            left: -999px;
            z-index:-999px;
            `
            audio1.controls="controls"
            audio1.oncanplaythrough =function(){
                document.body.appendChild(audio1)
                audio1.play()
              
            }
            audio1.onended=function(){
                document.body.removeChild(audio1)
            }
            audio1.src="data:audio/mp3;base64,"
        }
        let audio2 = null;

        document.onmousedown = function () {
            if (event.button == 0) {
                console.log("鼠标左键按下");
                audio2 = document.createElement("audio");
                audio2.controls = "controls";
                audio2.style = `
            position: absolute;
            top: -999px;
            left: -999px;
            z-index:-9999px;
            `
            audio2.currentTime="0.25"
            audio2.oncanplaythrough = function () {
                document.body.appendChild(audio2)
                audio2.play()
            }
            audio2.src="data:audio/mp3;base64,"
            }
        }
        document.onmouseup = function () {
            if (event.button == 0) {
                console.log("鼠标左键松开");
                audio2.pause();
                document.body.removeChild(audio2)
            }
        }
})()